import * as React from "react";
import { useState, useEffect } from "react";
import styled from "styled-components";
import axios from "axios";
import CategorieTab from "../components/CategoryTab";

export default function Home() {
  const [categorieDB, setCategorieDB] = useState<any>([]);

  const axios_GetCategorie = async () => {
    await axios
      .get("./data/Categories.json")
      .then((res) => setCategorieDB(res.data.CATEGORIES));
  };
  useEffect(() => {
    axios_GetCategorie();
  }, []);
  //console.log(categorieDB);
  return (
    <Container>
      <Header>커뮤니티</Header>
      {/* <Buttons> */}
      <CategorieTab item={categorieDB} />
      {/* {categorieDB.map((el: any, index: number) => (
          <CategorieTab index={index} item={el} />
        ))} */}
      {/* </Buttons> */}
      <Item></Item>
      <PostButtons>글쓰기 ✍️</PostButtons>
    </Container>
  );
}

const Container = styled.div`
  display: flex;
  position: relative;
  flex-direction: column;
  border: solid grey 1px;
  border-radius: 10px;
  width: 360px;
  height: 821px;
`;
const Header = styled.header`
  margin-top: 34px;
  margin-left: 30px;
  margin-bottom: 20px;
  width: 81px;
  line-height: 32px;
  height: 32px;
  font-weight: 700;
  font-size: 22px;
`;
const PostButtons = styled.button`
  font-weight: 700;
  background: white;
`;
const Item = styled.ul``;
